          on <time class="dt-published" datetime="2019-08-29 21:42:00">29<sup>th</sup> August 2019</time></p>
        <p>Updated on <time class="dt-updated" datetime="2019-08-30 10:44:00">30<sup>th</sup> August 2019 10:44</time></p>
        <div class="summary">
          <p class="p-summary">#QuestionTheWeb is a two phase intervention that recognizes agrumentation as a discourse. We first teach students to own their truth from their own domain and then understand how perspectives shape truth through the use of biased avatar based read alouds.</p>
