ill="#000000" fill-opacity="0.0" d="m1115.8188 561.3018l0 -42.173218" fill-rule="evenodd"/><path stroke="#000000" stroke-width="1.0" stroke-linejoin="round" stroke-linecap="butt" d="m1115.8188 561.3018l0 -36.173218" fill-rule="evenodd"/><path fill="#000000" stroke="#000000" stroke-width="1.0" stroke-linecap="butt" d="m1117.4706 525.1286l-1.6517334 -4.538086l-1.6517334 4.538086z" fill-rule="evenodd"/><path fill="#000000" fill-opacity="0.0" d="m1139.4226 415.1496l0 -42.173218" fill-rule="evenodd"/><path stroke="#000000" stroke-width="1.0" stroke-linejoin="round" stroke-linecap="butt" d="m1139.4226 415.1496l0 -36.173218" fill-rule="evenodd"/><path fill="#000000" stroke="#000000" stroke-width="1.0" stroke-linecap="butt" d="m1141.0743 378.97638l-1.6517334 -4.538086l-1.6517334 4.538086z" fill-rule="evenodd"/><path fill="#000000" fill-opacity="0.0" d="m1161.6036 268.89764l0 -42.173233" fill-rule="evenodd"/><path stroke="#000000" stroke-width="1.0" stroke-linejoin="round" stroke-linecap="butt" d="m1161.6036 268.89764l0 -36.173233" fill-rule="evenodd"/><path fill="#000000" stroke="#000000" stroke-width="1.0" stroke-linecap="butt" d="m1163.2554 232.72441l-1.6517334 -4.538101l-1.6517334 4.538101z" fill-rule="evenodd"/><path fill="#000000" fill-opacity="0.0" d="m1139.4226 1448.1273l0 49.196777" fill-rule="evenodd"/><path stroke="#000000" stroke-width="1.0" stroke-linejoin="round" stroke-linecap="butt" d="m1139.4226 1448.1273l0 43.196777" fill-rule="evenodd"/><path fill="#000000" stroke="#000000" stroke-width="1.0" stroke-linecap="butt" d="m1137.7709 1491.3241l1.6517334 4.538208l1.6517334 -4.538208z" fill-rule="evenodd"/><path fill="#000000" fill-opacity="0.0" d="m1161.6036 1600.2743l0 49.196777" fill-rule="evenodd"/><path stroke="#000000" stroke-width="1.0" stroke-linejoin="round" stroke-linecap="butt" d="m1161.6036 1600.2743l0 43.196777" fill-rule="evenodd"/><path fill="#000000" stroke="#000000" stroke-width="1.0" stroke-linecap="butt" d="m1159.9519 1643.4711l1.6517334 4.538208l1.6517334 -4.538208z" fill-rule="evenodd"/></g></svg>
          <p>#QuestionTheWeb&nbsp;builds our theory of change from an overarching lens of Argumentation as Discourse (Applebee &amp; Langer, Beach &amp; Newell, 2015; 2013, Hillocks, 1986). Teaching students the norms of academic writing remains one of the most consistent challenges for teachers of the English language arts. The earliest comprehensive studies of writing instruction at the high school level suggested that most students were taught highly formulaic structures for producing academic argument (Applebee &amp; Langer, 2013, Hillocks, 1986), and that trend has remained consistent over time (Applebee and Langer, Newell et al., 2015). Teaching and learning academic argument, especially in middle- and high-schools, is often reduced to formulaic essay structures. In fact, Newell et al. suggests that we need to expand what counts in the teaching of argumentation</p>
          <p>To clarify: what counts as argumentative writing, indeed what counts as argumentation more generally, is not a given. It is not something that just exists. It is instead a set of social practices deeply embedded in our everyday lives and the social institutions in which we all participate. It is socially constructed through and exists only through teaching and learning (Newell&nbsp;et al, 2015, p. 1)</p>
          <p>From a theory of Argumentation as Discourse we will reach our stated outcomes through two phases that draw on empirical research in their design. In the first phase we focus on bridging the cognitive and social practices of argumentation by focusing on the writer as an agent as we operationalize our theory of change through blogging. Then, in the second phase, we draw on calls to unite the domains of reading and writing to teach argumentation by having students interact with read alouds, biased avatars, and graphic organizers. Before we can begin to focus on reading and writing skills, however, we first address the social practices inherent in argumentation</p>
          <h4 id="1-3-1">1.3.1 Bridging Cognitive Skills and Social Practices of Argumentation.</h4>
          <p>From Argumentation as Discourse we begin by recognizing the need to bridge cognitive and social practices in writing instruction. Reznitskaya &amp; Anderson (2002), for example, lay out methodologies and explain the reasoning for cognitive and social integration in Argument Schema Theory. Furthermore, in a review of research on argumentative writing Newell et al. (2015) called for an integration of the skills and social practices. We continue this effort by building our theory of change on self-efficacy, identity, dialogical discourse, and community</p>
          <h5 id="1-3-1-1">1.3.1.1 Self-Efficacy</h5>
          <p>Studies have suggested that self-efficacy&nbsp;has a strong impact on learning (Bandura &amp; Zimmerman, 1995). Research reveals that students with low self-efficacy do not engage in metacognitive practices around their learning (Walker, 2003). Yet metacognitive reflection is the cornerstone of much of the instruction and feedback in argumentative writing (Newell et al., 2015). If we want students to see writing as part of a universal search for knowledge, then we must improve self-efficacy skills. Additionally, students with low self-efficacy in writing focus on extrinsic motivations (e.g., grades) instead of the overarching goal of improving writing (Linnenbrink &amp; Pintrich, 2003). Students also need to consider their self-efficacy with digital writing tools, especially since belief in one's skills with digital tools can predict performance in inquiry tasks (Leu et al. 2015) We also know that some students approach digital writing with higher self-efficacy than traditional paper genres taught in school (Meyers &amp; Beach, 2008).</p>
          <h5 id="1-3-1-2">1.3.1.2 Agency</h5>
          <p>A theory of change based on Argumentation as Discourse recognizes the role of the learner. Building upon work by Scardamailia (2009), who argues for epistemic agency giving students control over all the range of knowledge building skills.&nbsp;we suggests learners&rsquo; control of the topic, audience, and impact of writing will improve learning. Durst (2009) argues that we see students express agency by resisting curriculum and suggests instead we should professionalize and make their goals central. Beyond resisting the curriculum, agency impacts writing ability; Sheehy (2003) found that, when students sensed a lack of agency, they did not invest effort in writing.</p>
          <p>Teachers can encourage agency in the classroom. To negate the detrimental impact of lack of agency, Sheehy worked with students to formalize the genre for specific audiences and this led to a collaborative sense of agency and the exchange of strategies. Research suggests there are benefits to using digital texts to increase agency of writers. O'Brien, Beach, and Scrhaber (2007) found struggling readers and writers develop agency in digital texts. Multiple studies find having students write for authentic purposes improves their writing. In fact, giving students critical questions leads to increased frequencies of claims in student writing (Nusbaum &amp; Edwards, 2011). As educators channel learner agency, they help to increase student identities as writers.</p>
          <h5 id="1-3-1-3">1.3.1.3 Identity</h5>
          <p>Identity and agency are deeply intertwined. Once students sense ownership over their writing, educators can help students build on their identities as a writer. Any theory of change that begins with Argumentation as a Discourse must recognize the role identity plays in writing (Scardamalia, &amp; Bereiter, 2006). By focusing on individuals rather than outcomes, we hope to break from cycles of programmatic writing instruction. In fact, Trainor (2009) noted that we must think about our framing when students build identities, or they may construct in opposition to the classroom in response to spaces that provide no agency.</p>
          <p>We also know that multimodal tools provide opportunities for students to try identity kits (Gee, 2009), or play with different discourses that signify membership. Johnson (2007) demonstrated how students creatively played with dress and identity to navigate social norms. Similarly, Zoss et al. (2008) found multimodal construction of masks as an avenue for identity construction with adolescent boys. These opportunities to try on different identities are essential as students learn to adopt different voices (Elbow, 2000) through classroom and teacher models (Lee, 2007). As students develop different voices they can begin to engage in dialogic&nbsp;discourse.</p>
          <h5 id="1-3-1-4">1.3.1.4 Dialogical Discourse</h5>
          <p>An intervention based on a theory of Argumentation as Discourse&nbsp;recognizes Bhaktin's notion of doubletalk (Newell et al., 2015). Double voicing refers to adopting different worldviews as a tool for building community. In writing research, this may mean speaking to an audience, to other students in the class, or even to one's own past through written reflection (Newell et al., 2015).</p>
          <p>In argumentative writing research, attending to and adopting different perspectives has shown promise. Felton &amp; Herko (2004) found students speaking to their claims and to those of their peers by graphing arguments led to greater counterclaims. Lunsford (2002) found through doubletalk that definitions of key terms in graphic organizers or models of arguments, specifically Toulmin, are not settled and evolve with student writing.</p>
          <p>We also recognize the dialogical role of double voice through the creation of avatars or temporal identities.. Nystrand (2002) found students construct personas with strong beliefs when writing. When developing their own belief systems in argumentative writing, researchers have found it takes multiple iterations of writing and single persuasive essays do not allow for the internal dialogue required to understand the perspectives involved in an issue (van Eemeren &amp; Grootendorst, 2004; Walton, 1998, 2007). Instead students simply adopt a double talk and write papers to a school context rather than to a suggested audience (Smidt, 2002).</p>
          <p>Studies have indicated&nbsp;online interactions and role play may increase the efficacy of dialogical discourse in the classroom (Newell et al. 2015. Beach and Doerr-Stevens (2011) found that moving from online to real contexts allowed students to use double talk to change school policies. Online interactions have also been shown to shift student arguments (Morgan &amp; Beaumont, 2003) and, while some studies have shown face to face arguments to be richer, different conditions did not translate to difference in writing (Joiner, Jones, &amp; Doherty, 2008).</p>
          <p>Others argue that we need a reciprocal relationship with the student and teacher (Wallace &amp; Ewald, 2000). Dialogical discourse can be encouraged through the use of feedback and reflective conversations (Gorzelsky, 2009). The use of feedback drives discourse which in turn encourages peers to engage with each other and thus help to build a community of writers.</p>
          <h5 id="1-3-1-5">1.3.1.5 Community of Writers</h5>
          <p>Community is essential to process writing (Applebee &amp; Langer, 2013; Graham et al., 2016; Graham, &amp; Perin, 2007; National Council of Teachers of English, 2016; Troia &amp; Olinghouse, 2013). In writing communities outside school, community drives all learning (Winn, 2015), and it is this community that has enabled the web to thrive. In fact, Scardamalia and Bereiter (2006) argue we should look to grow the knowledge of the community rather than the individual writer.</p>
          <p>Atwell (1998) has long called for teachers to come out from behind their desks and join students as writers. This step starts to form a community that will allow students to see themselves as writers by "changing knowledge, skill, and discourse&nbsp;as part of a developing identity" (Lave &amp; Wenger, 1991, p. 12). Numerous studies have shown the power of building a community of writers (Brokerick, 2015; Hall, 2015; Hull, Stornaiuolo, &amp; Sahni, 2010; Wright &amp; Mahiri, 2012) to bridge the cognitive skills with social practices.</p>
          <p>Communities of writers have been essential in online spaces (O'Byrne, 2015). This is especially pronounced in English language learners (Yi, 2008) who turn to community for fanfiction writing (Black, 2005), identity work (Gee, 2015), and connections to home cultures. Online communities have also been shown to increase writing by giving students a place to share (Kehus, 2000).</p>
          <p>At the same time online spaces can create negative writing behaviors (Chandler-Olcott, 2014) and this requires a holistic approach to creating community (Hagood, 2011) that re-centers writing communities to consider online spaces (Grisham &amp; Wolsey, 2005). By intentionally designing online spaces for writing communities, educators can take advantage of the affordances of technology while actively modeling civic engagement in these spaces and improve student cognitive&nbsp;skills through the delivery of feedback.</p>
          <h4 id="1-3-2">1.3.2 Operationalizing Our Theory of Change in Phase I</h4>
          <p>When given the opportunity to develop pieces of writing for their own blog, students will engage in the social practices necessary for argumentative writing. In Phase I, students will explore markers of credibility and consider how an author&rsquo;s point of view impacts the textual choices of the writer. Then, in the second phase of the intervention, students will encounter biased read alouds and reflective blog posts written by avatar characters who interact with students.</p>
          <p>We can embed and reinforce these social practices through the use of an interactive reading and writing platform. Improving argumentative writing skills requires a focus on sourcing skills (Birkenstein &amp; Graff, 2018; Harris, 2006). The social reader that emerges from this project will enable students to annotate sources for claims and evidence, review the claims of others, and leave comments for their peers. This will help students see an argument not as a thesis or position but as a socially complex text that unfolds in real-time while being situated in history. Students encounter these texts across different networks with various amplification and authority (McVerry, 2015). By focusing on first telling the story of oneself,we build on our theory of change of Argumentation as Discourse.</p>
          <p>In the first phase of our intervention, we will operationalize our theory of change by (a) supporting expression of agency, the opportunity to reflect and create identities, (b) relying on dialogical discourse, and (c) building the self-efficacy of participants. This will mainly occur as students develop a personal website and blog. The learning activities included in Phase I all draw from previous research drawn from our theory of change.</p>
          <p>In the early days of the internet, youth designed their identities in spaces they controlled (boyd, 2014). Now the spaces of reading and writing are algorithmically driven, and the design choices severely limited for the user (Best, Manktelow, &amp; Taylor, 2014). Machines often determine which photographs students see from friends. The news youth read is promoted by bots across social media. As youth engage in these reading and writing spaces, it is imperative that they know to #QuestionTheWeb (Barker, 2009; Leu, 2015). In Phase II of the intervention, we will build dialogical discourse among students.</p>
          <h5 id="1-3-2-1">1.3.2.1 Domain Of One's Own.</h5>
          <p>In fact, we hope to build student agency and efficacy through multiple steps in our intervention by utilizing dialogical discourse about one's own identity. Dialogical discourse is at the heart of our theory of change, and we believe in providing students opportunities for multimodal identity construction (Zoss et al, 2008). Allowing participants to first question their own voice will prepare them to speak to claims first by peers and then by others (Felton &amp; Herko, 2004).Given the need for youth to hone critical evaluation skills, particularly in light of the effectiveness of writing communities and the rise of fake news, the proposed #QTW instructional model begins by focusing on spaces where students consume information and construct meaning. It is essential for students to &ldquo;manage and consider the implications of becoming the owner of their own story&rdquo; (Groom &amp; Lamb, 2014) not only to understand themselves as a reader and writer, but also understanding how perspectives shape claims and evidence is a core critical literacy skill. In other words, it is much easier for students to understand how an author uses the affordances of digital tools to shape truths after they have experienced shaping their own.</p>
          <h5 id="1-3-2-2">1.3.2.2 Power of Student Blogging.</h5>
          <p>Teaching argumentation first through student blogging will create a sense of ownership leading to greater agency while providing the time and space to build self-efficacy skills with technology. Work done in content areas with Internet inquiry shows an initial drop in knowledge acquisition (Leu technical report), and studies of online learning find it often takes four weeks for students to adjust. By providing time to develop one's identity as a writer, we hope to take advantage of growing self-efficacy.</p>
          <h5 id="1-3-2-3">1.3.2.3 Critical Questions.</h5>
          <p>After students build their personal websites they will choose from a set of critical questions (Nusbaum and Edwards, 2011) around the use of digital technology and social media in their lives. As they delve into these questions, students will learn to produce different types of multimedia compositions, such as podcasts, photos, videos, and infographics. This will allow us to teach critical multimodal composition skills (Newell et al., 2015) while also providing agency to those who might find refuge in digital texts (Beach &amp; Meyers, 2008). As students engage with these questions they will learn to annotate texts for markers of credibility.</p>
          <h5 id="1-3-2-4">1.3.2.4 Dialogical Reflections.</h5>
          <p>While students develop efficacy and knowledge with new forms of textual communication they will also be publishing reflection posts explaining how they learn. Creating an internal reflective dialogue will encourage the double talk (Bakhtin, 1985) that students need when questioning different genres and perspectives. More importantly, we provide students an opportunity to learn how to learn through reflection. This will also professionalize their writing around their goals to improve agency (Durst, 2009).</p>
          <h5 id="1-3-2-5">1.3.2.5 Choice in Inquiry.</h5>
          <p>Finally in Phase I students, will have to choose a personal challenge around technology or digital media. This could be a period of not using social media, a personal goal to write or shoot photos once a day, or a project to examine body image online. By allowing students choice in their expression, we hope students will learn to see themselves as writers with increased self efficacy and agency.</p>
          <p>Throughout the first intervention phase we will also strive, and consistently evaluate the space, both the classroom and online interactions, encouraging a community of writers. We will take lessons from out of school literacy spaces (Winn, 2015) and ensure students have a space to explore their own identities. Specifically, we will use a code of conduct, modeling, and video guides to create the community. We will take field notes on the participatory practices and seek to increase these goals through constant iteration in our formative design.</p>
          <h4 id="1-3-3">1.3.3 Unifying Theories of Reading and Writing</h4>
          <p>In order to overcome the challenges of teaching argumentation we must not only combine cognitive skills and social practices but also address an interactive theory (Flowers, 1989; Newell et al., 2015) towards reading and writing. To this end the second phase of our intervention seeks to use dialogical discourse to improve both critical evaluation skills while reading sources and argumentative writing as students undergo activities in the reading of websites and the creation of argumentative texts. Through an interactive approach to reading and writing, we hope to see evidence of greater appropriation (Rogoff, 1995) of cognitive skills and social practices.</p>
          <h5 id="1-3-3-1">1.3.3.1 Reading and Writing Argumentative Texts</h5>
          <p>Cognitive approaches have identified many skills associated with argumentation, yet students still struggle. Researchers often find readers ignore information that does not align to their perspective (Perkins et al., 1991) and skills rarely transfer (Newell et al., 2011). In terms of sourcing, school students rarely engage in critiquing author perspective or text (Brante &amp; Str&oslash;ms&oslash;, 2018). As they write students do not make critical judgements (Perie, Grigg, &amp; Donahue, 2005) and show a lack of analytical writing&nbsp;(Persky, Daane, &amp; Jin, 2003). Our theory of change suggests decontextual skill instruction does not effectively teach argumentation.</p>
          <h5 id="1-3-3-2">1.3.3.2 Dialogical Interactions</h5>
          <p>Promising research has been done&nbsp;in the investigation of interactions through Cognitive Reasoning (Anderson et al, 2001; Jabadallah et al, 2011; Reznitskaya et al., 2007, 2009; Waggoner, Chinn, Yi, &amp; Anderson, 1995) where the intersection of written models and student and teacher talk translate into rhetorical moves for investigating texts or crafting claims. These textual moves are greatest when the teacher consistently asks for evidence and provides feedback for the use of evidence (Jabadallah, 2011). Therefore any intervention must focus on encouraging interactions that solicit and deliver feedback. This should focus specifically on the process of evaluating and adopting of perspectives. This has to occur in a learning environment full of interactions that create dialogues with text (Newell et al., 2015) and their authors.</p>
          <h5 id="1-3-3-3">1.3.3.3 Text Structure</h5>
          <p>Interventions asking readers and writers to evaluate texts structure have a long shown promise. Ambruster, Anderson, and Ortega (1989) explored text frames with expository texts and demonstrated that attuning to structure improves comprehension. In argumentative writing this has usually involved the use of a graphic organizers (Brooks &amp; Jeong, 2006; Easterday, Aleven, &amp; Scheines, 2007; Nussbaum &amp; Kardish, 2005). These tools have been consistently helpful in encouraging the use of exploring counter-arguments (Newell et al., 2015) which is an essential step in considering multiple perspectives. Graphic organizers also provide rich data sources for evaluation. Any intervention focused on teaching the reading and writing of argumentation should utilize these tools.</p>
          <h5 id="1-3-3-4">1.3.3.4 Read Alouds</h5>
          <p>Reading aloud in secondary schools has recently shown promise (Braun, 2010; Fisher &amp; Iver, 2006; Ivey, 2003) including argumentative texts (Hillocks, 2010). Ivey (1999) noted that struggling readers in middle school especially benefit from read alouds and they enjoy the performative nature of reading and writing. Thus, any intervention focused on teaching argumentation with struggling readers should provide scaffolds for reading aloud and should encourage read alouds by the instructor.</p>
          <p>Any intervention designed to teach argumentation must differentiate for reading ability. Including teacher read alouds can help ensure the success of all students. These read alouds can be small group, teacher lead, or even mediated using technology.</p>
          <h5 id="1-3-3-5">1.3.3.5 Mentor Texts</h5>
          <p>Providing mentor texts for students to read and analyze has moderate effects in improving writing ability, as students learn how to well written texts are crafted. (Caswell &amp; Duke, 1998; Duke &amp; Kays, 1998; Maloch, 2008). Knduson (1989) found exposure to models of expository texts to have the strongest effect (.25) of four different interventions. This same trend with young readers is supported with adolescents (Graham &amp; Perin, 2007; Hillocks, 1986). Chambliss (1995) noted that in teaching argumentation, most focus on textual clues. Pytash et al., (2014), through self report instruments, found mentor texts improved students' understanding of why authors write in economics.</p>
          <p>The use of mentor texts in argumentation provides the chance for dialogical interactions and&nbsp;the teaching of reading and writing. Students not only identified elements of the craft, but also gained understanding of author perspective. Any intervention based on Argumentation as Discourse should widely deploy the use of mentor texts.</p>
          <h5 id="1-3-3-6">1.3.3.6 Modeling</h5>
          <p>Teachers have long used models in teaching of writing. Studies have found struggling readers and writers benefit from teachers modeling (Fisher &amp; Frey, 2012). Schunk (1991) noted that writing models work best when learners perceive they are on their level. Graham &amp; Harris (1994) found teacher modeling improved writing. Braaksma et al. (2002) confirmed that similarity between the model and learner skills lead to the greatest improvements when compared to expert models. Sawyer (1992) found that models work better with skilled students, and studies of models and direct instruction with struggling students find direct instruction will suffice in teaching writing strategies (Schultz, 1997).</p>
          <p>Current research reveals modeling of reading argumentative tasks may be more effective for struggliningreaders but models of of argumentative writing maybe more effective with skilled students. In our theory of change, with an interaction approach to literacy, we believe the modeling of reading and writing can not be separated from each other nor direct instruction. It is also clear from the literature that difference in quality between the student work and the model impacts learning. Therefore any intervention should utilize models that are written at the student level while stressing important features such as signal words (Heibert, 2017) through direct instruction.</p>
          <h5 id="1-3-3-7">1.3.3.7 Online Texts</h5>
          <p>Much of the research in argumentation has started to study texts in online spaces. Studies examining differences between offline and online argumentation have found that there may be some differences in face to face discussions but the writing products do not significantly vary in quality (Joiner, Jones, &amp; Doherty, 2008). In fact, others have found the unique affordances of online discussions lead to greater dialogical interactions (Beach &amp; Doerr-Stevens, 2009). Given that the majority of students now consume more online than offline texts (Fox &amp; Grainnie), it is critical we teach argumentation in online spaces. Furthermore, given the role of misinformation, we have a critical need as a nation to make sure students can evaluate online information.</p>
          <p>Researchers have also taken advantage of computer aided tools to scaffold learning (Scheuer et al.,2010). Students have read articles as text maps (Dwyer, Hogan, &amp; Stewart, 2010) and found no difference than reading a full text. Numerous studies look at the use of computer generated graphic organizers (Dowell et al., 2009; Salminen, Marttunen, &amp; Laurinen, 2010; Suthers et al., 2008). In these studies, computer aided scaffolds lead to increased number of arguments in writing but little is known about whether this transfers to other situations. Any study utilizing online writing spaces should allow for the use of graphic organizers. Further efforts should be made to see how graphic organizers increase dialogical interactions</p>
          <p>While the use of models and graphic organizers maps to similar results with offline text the role of authority shifts online (Newell et al., 2015) through the creation of believable personas or avatars (Bogost, 2007; Jamaludin, Chee, &amp; Ho, 2007; Rourke et al., 1999; Swan, 2002.) In their study of online role play to teach argumentative writing, Beach &amp; Doerr-Stevens (2009) noted that students who created avatars with more credible personas were seen as perceived as experts. Any study examining dialogical interactions in online spaces should attune learners to how markers of authority are amplified.</p>
          <h4 id="1-3-4">1.3.4 Operationalizing our Theory of Change in Phase II</h4>
          <p>Phase II&nbsp;of our intervention, based off of Kuhn and Cohen's (2011) study may lead to improvements in both critical evaluation skills and argumentative writing as we seek to integrate research of cognitive perspectives and social perspectives (Newell et al.,2011) while addressing the lack of research unifying reading and writing of argumentative texts.</p>
          <p>In Phase II students will first begin what Kuhn and Cohen labeled the &ldquo;pre-game&rdquo; by completing a series of challenges around the critical evaluation of websites. Researchers will create short ten minute puzzles and class challenges around identifying authors, evaluating authority, and evaluating bias. Students will also complete challenges around identifying claims, sources, and evidence verification.</p>
          <p>During the "game component&rdquo; of the lesson (Kuhn &amp; Cohen, 2011) participants will be put into dyads or triads and enter a simulated web environment. Webpages will be recreated following the methods of Leu et al. (2018) in the development of the IES funded online reading comprehension assessment (see Appendix C). There will be pages around consequential topics. Students will choose from the list. Each topic will consist of two perspectives. Each perspective of an issue will have four sources. There will be two websites representing each side of an issue and an informational source.</p>
          <p>As they enter a source, participants will be greeted by a video avatar in the lower right hand corner, a character they can toggle on and off. As students read the website, the character, who has a background persona, will annotate the site from their bias. For example, a representative from the Chamber of Commerce might call a "Carbon Tax" too expensive a solution to climate change and call into question the cost listed on a website from an environmental group. Each avatar will read two sources confirming their bias and one source they oppose. As the avatars discuss the text, they will pay close attention to textual features, such as signal words and rhetorical devices. Participants will trace the text structure of each source using a graphic organizer. The groups will each publish two blog posts: one explaining why each character is right and another explaining why each is wrong.</p>
          <p>In the "end game" (Kuhn &amp; Cohen, 2011), students will then choose a different topic from the list. Using the same interactive graphic organizers students will investigate the issue on the open web using the provided sources but without the avatar read alouds. They will then publish a multimedia essay on the topic.</p>
          <p>While the use of the topics and sources previously used by their peers may introduce a prior knowledge bias, the performance on this essay is not included in our final models. By limiting students to our simulated sources we reduce the need to include searching skills as a covariate. Finally, this also fits our theory of change given that argumentation around a subject should unfold over time in discussion, reading, and writing.</p>
          <h3 id="1-4">1.4 Summary of the Significance of This Proposal in Relation to the IES Review Criteria</h3>
          <p>The primary purpose of this grant is to increase writing proficiency among adolescent youth. We build on existing models and lessons learned from teaching student blogging over the last eleven years (Hicks &amp; McVerry, 2007). There has never been a large-scale IES study to see what, if any, effect student blogging can have on argumentative writing scores.</p>
          <p>We also address the need to explore alternative writing assessments. By teaming with the National Writing Project in the use of the Analytic Writing Continuum Source-Based Argument (AWC-SBA), we will provide insight into assessing writing.</p>
          <p>As scholars we must also understand how to best shape hybrid learning environments to support developing writers. This study seeks to expand the boundaries of the classroom beyond typical school-day times and spaces, providing insight into how educators should use the affordances of technology to overcome the persistent failure in teaching argumentative writing.</p>
          <p>Finally, we believe students cannot learn how to engage in formulating arguments without investing heavily in learning source evaluation. This study seeks to link the critical evaluation of online sources (Leu, Foranzi, &amp; Kennedy, 2015) with argumentative writing.</p>
          <h2 id="2">2.0 Research Plan</h2>
          <p>This developmental goal research grant will occur over four years. The first two years will be formative design studies. In Year Three, we conduct a switching replication design pilot study. Year Four involves data analysis and a cost/benefit study.</p>
