          <h3 id="2-2">2.2 Baseline Assessments</h3>
          <h4 id="2-1-1">2.2.1 Analytic Writing Continuum.</h4>
          <p> In 2013, NWP developed the AWC for Source-Based Argument (AWC-SBA) to focus on specific features of source-based argument writing. In adapting the AWC, NWP reviewed extant argument writing rubrics (e.g., the Smarter Balanced and PARCC rubrics). The AWC-SBA retain the AWC&rsquo;s basic structure rooted in the &ldquo;six traits&rdquo; of writing but each has a particular focus on the attributes related to source-based argument writing. The AWC-SBA measures four attributes: content (e.g., quality of reasoning and strength of evidence); structure (e.g., organization to enhance the argument); stance (e.g., tone, establishment of credibility); and conventions (e.g., control of usage, punctuation, spelling, capitalization, and paragraphing). The AWC-SBA has been used in three large-scale scorings (n&gt;5,000). Reliability estimates for the AWC-SBA ranged from 89%&ndash;92% on each attribute (Gallagher, Arshan, &amp; Woodworth, 2017).</p>
          <h4 id="2-2-2">2.2.2 Critical Online Information Literacies Assessment</h4>
          <p>COIL is a previously validated multiple choice assessment of website evaluation. The Critical Online Information Literacies (COIL) instrument is based on measures developed by Kiili, Laurinen and Marttunen (2008), Brem, Russell, and Weems (2001), and Leu et al. (2010). The final instrument is delivered using an online survey tool. The items measured each of the following constructs: author, bias, publisher, and source. The COIL contained forced response answers that included entire screenshots of websites. This violates basic principles of comprehension assessment that call for short distractors (Fuchs, Fuchs, &amp; Maxwell, 1988; Keenan &amp; Betjemann, 2008). However, in each administration of the COIL, the reliability had a coefficient alpha that exceeded 70% (McVerry, 2013) which will meet the needs of a developmental research grant.</p>
          <h4 id="2-2-3">2.2.3 Writing Self-Efficacy. </h4>
          <p>The Self-Efficacy for Writing Scale&nbsp;(SEWS)&nbsp;(Bruning et al., 2013) will be used to estimate writing efficacy. The measure contains items that assess load on three scales: (1) self-efficacy for writing ideation, (2) writing conventions, and (3) writing self-regulation. More specifically, following Bruning et al.&rsquo;s design, the instrument will include 16 items that examine the three aforementioned dimensions of self-efficacy for writing: (1) Ideation (five items); (2) Conventions (five items); and (3) Self-regulation (six items). Following recommendations by Bandura (2006) and Pajares and Schunk (2001), the Self-Efficacy for Writing Scale (SEWS; Bruning et al., 2013) includes items answered on a Likert scale from 0 (&ldquo;I'm not sure I could do&rdquo;) to 100 (&ldquo;I'm totally sure I could do&rdquo;).</p>
          <h4 id="2-2-4">2.2.4 Survey of Internet Use and Online Reading.</h4>
          <p>This online survey identifies frequency and type of Internet use inside and outside school, as well as assesses knowledge and skills related to Internet-based reading and writing activities. With funding from a previous IES project, it was developed, field tested, revised, and then administered to approximately 1600 middle-grade students in several urban and rural school districts under the supervision of Dr. James Witte at Clemson University, a nationally recognized expert in online survey development. Samples appear in Appendix (X). This survey has been previously validated and used in numerous studies (Leu et al., 2004; Leu et al., 2007, Leu et al., 2016)</p>
          <h3 id="2-3">2.3 Formative Design in Year One</h3>
          <p>We will use a series of design experiments (Brown, 1992; Cobbet al., 2003) to build upon our existing model of teaching argumentative writing with students composing texts and posting them to their own domain/blog. Our design experiments are distinctive in that they engage teachers as &ldquo;insiders&rdquo; who collaborate with the research team, using outcome data to revise the curriculum and tools before experimentation.</p>
          <p>In Year One, we begin with our pedagogical goal to improve the self efficacy and ability of adolescents to critically evaluate sources and use this evidence in argumentative writing.</p>
          <h4 id="2-3-1">2.3.1 Year One Research Question.</h4>
          <p> In a formative experiment, we must identify essential components of the intervention to be studied a priori to implementation and data collection (Reinking &amp; Bradley, 2008) and then&nbsp;iterate on this understanding as we identify variables and strategies that enhance our pedagogical goal.&nbsp;In Year One we will ask, &ldquo;What are the essential components a hybrid writing environment needed to improve argumentative writing when we give every student their own domain?</p>
          <h4 id="2-3-2">2.3.2 Overview of Research Activities. </h4>
        <p>The formative design experiment in Year One of the study will follow a three phase model adapted from Reinking and Bradley (2004, 2008; see also Reinking &amp; Watkins, 1998): (a) gathering baseline data; (b) implementing and developing the intervention based on data collection and analysis; (c) retrospective analysis.</p>
        <p><strong>Setting:</strong> The formative design study will take place in one school district in Connecticut in two classrooms. We will begin with a one-day training for teachers on the technology of blogging and setting up their own personal websites. We will then provide a second day overview on the interventions. Then we will follow an iterative design process.</p>
        <p>The participants will have access to an online coach who will offer pre-recorded tutorials on an as needed basis. Teachers will be able to attend open office hours that are hosted online. These will be drop-in sessions using video chat software.</p>
        <p><strong>Phase 1: Gathering Baseline Data. </strong> We will begin by gathering background data on how the school previously taught source evaluation and argumentative writing. Interviews will be conducted with the teachers and classroom observations conducted</p>
        <p>We will then administer the baseline assessments of writing efficacy and the COIL assessment of critical evaluation. The Critical Online Information Literacies Inventory will be scored to identify key areas of instruction. The ACW, which is out student outcome measure will be scored after the three year data collection.</p>
        <p><strong>Phase II: Implementing and Developing the Intervention.</strong> Once the learning activities are developed, we will focus on the delivery of the learning activities. These activities will center around the role of identity and social media. Students will then practice sourcing skills as they read about &ldquo;The effect of social media&rdquo; while making argumentative writing pieces across a variety of modes. They will then create &ldquo;their most credible self&rdquo; while building an About Me Page.</p>
        <p>The development of these lessons will occur over an eight-week period. The graduate student and project manager will work with the teacher and act as participant observers by intentionally designing lessons for a hybrid learning spaces. We will establish a set of learning goals for Phase 1.</p>
        <p>These goals will then be taken by the research team and proposed learning activities will be developed. Each activity will be based on a read, write, participate model (McVerry, Belshaw, O&rsquo;Byrne, 2015) where students read and annotate a text, write a reaction to the text, and then participate in an activity that required the use of content from the text.</p>
        <p>After the learning activities are developed they will be sent back to the scientific advisory board for content validity. Participants will be asked to identify the skill being taught, how important they believe the skill to be, and how sure they are in their answer. Using these data we will calculate a content validity ratio. We will also ask for general qualitative feedback on the learning activities.</p>
        <p>Along with The classroom teachers, we will then identify 2-4 writers in each class as focal students for cognitive labs. These students will offer feedback on the lessons and on the user experience of having a blog on their own domain and a hybrid learning environment that allows students to curate, read, and comment on the blog post of their peers. We will also have students work through tutorials and lesson plans while thinking out loud.</p>
        <p>We will then finalize the Phase I lessons. The collection of activities will then be refined and reviewed by the scientific advisory board. Next we will meet with teachers and identify any areas where they may need instructional support. The lessons will then be taught in their classrooms for a period of eight weeks, twice a week, for one class session.</p>
        <p>After the first iteration, the PIs and graduate researchers will use the data collected to revise the learning activities. They will analyze field notes and teacher reflections. Student feedback about what they like will be collected and coded using a dichotomous plus/delta format. Student work also will be coded using methods suggested by Kuhn and Crowell (2011). Student writing will be parsed into idea units, and each idea unit was classified into one of four categories (no argument, own-side argument, dual-perspective argument, or integrative-perspective argument). Using these tools, we will decide if lessons need revision to meet our pedagogical goals.</p>
        <p>The lessons will then again be delivered to another class. However, these students will have access to their websites from the beginning of the study. This will allow us to understand the impact new technology has on the learning environments and outcomes, meaning we will be able to compare our data between the two groups to see if pre-exposure to the tools lead to greater writing efficacy.</p>
        <p><strong>Phase II: Implementing and Developing the Technology. </strong>As we iterate on the lesson plans, we will develop the blogging platform for students to use. As stated, we are not creating a &ldquo;new&rdquo; platform or learning management system. Instead we are encouraging students to blog from their own web domain using a customized theme we create, including both the blogging tools and the updated h-feed reader.</p>
        <p>While we are using mature web standards and will be using well-established, open source solutions, we will be doing some custom development in Year One. We will use industry standard methods to evaluate accessibility and use of the tools. In the Year One formative design, the goals will be to test and develop technologies that will make the platform available on any desktop or mobile device:</p>
        <img src=""
        <ul>
          <li>Functioning comment system called webmentions</li>
          <li>Functioning annotation system called fragmentions</li>
          <li>A coding vocabulary for markers of credibility</li>
          <li>A social reader with APIs for publishing writing called micropub (writing) and another for curating a collection of websites to read called microsub</li>
        </ul>
        <p>These blogging tools use very specific types of metadata directly in the html file of every post, and this metadata is called microformats. This has been a tool used on the web for over thirteen years. Using this metadata, students will be able to send comments back and forth to each other from their own websites. This uses a technology called webmentions. They will be able to highlight and annotate each other&rsquo;s blogs from their own website using a technology called fragmentions.</p>
        <p>The students also will have a social reader that enables them to curate all posts from their classmates and the teacher. They will be add other feeds using a syndication technology called h-feed. This tool will be catered to the purpose of source evaluation. For example, we will have a tag for evaluating the claims and evidence used by their peers. Students will highlight blog posts of their peers and then judge the credibility of the evidence.</p>
        <p>The teacher will be given a social reader with additional tools for tracking the progress. This includes counts of publishing and commenting, the number of claims evaluated by students, and relational maps that illustrate which students interact together. The teacher will also be able to deliver feedback and comments to their students directly from their social reader.</p>
        <p>The students will also have an annotation tool with codes they develop and also used by the W3C credibility community group in predictive models of website credibility (Hawke, et al, 2018). These metadata vocabularies will allow us to triangulate student growth with our other measures.</p>
        <p>In the Year One formative design study we will work on refining existing tools through an iterative process that focuses on the environment of the user interaction as well as the user experience (See Appendix C). Weekly design sprints will be used based on a roadmap developed a priori but later revised based on the data collected. The overall software development goal for the Year One formative design is a refinement of existing technologies to meet our classroom needs.</p>
        <p><strong>Data Collection and Analysis.</strong>The graduate assistants will act as participant observers who will provide assistance to the classroom teacher, who will remain the primary instructor and deliver the lessons included in the intervention. A graduate assistant will be in attendance for the twice-weekly delivery. The principal investigators will provide just-in-time coaching and feedback.</p>
        <p>Qualitative data will include (a) field notes recorded and analyzed by graduate research assistants who have had explicit training in gathering and analyzing qualitative data; (b) teacher logs with observations and reflections about #QuestionTheWeb, which are particularly useful for our awareness of possible effects and issues that arise during times when a member of the research team is not present; (c) weekly interviews/debriefings (15-30 minutes) with teachers conducted by a member of the research team, which will be recorded and transcribed; and (d) periodic focus-group interviews with students.</p>
        <p>The protocol for collecting class observations for qualitative research will be developed during this face. Specifically the participant observers will rate a classroom on elements of participatory learning environments. A draft framework is included in the Appendix. Researchers will observe classes for elements that lead to greater dialogical interaction of four different categories: leading, building, communicating, and thinking. The PIs will first work with research assistance to establish anchor observations and discuss difference in scale. The instrument will undergo iterative design.</p>
        <p>Student artifacts such as digital presentations and various assignments will also be included in data collection and analysis. These data will primarily guide development, but will also include theoretical notes aimed at generating broader pedagogical theories and generalizations across contexts related to implementing a digital tools to teach argumentation. As noted, the research team will meet at least every two weeks to conduct preliminary retrospective analyses aimed at generating broader theoretical understandings and at sharing observations across sites focusing on determining (a) factors that enhance or inhibit #QTW success in achieving its goals, (b) what modifications or adaptations were made in response to that data, and (c) whether the modifications or adaptations produced desirable results.</p>
        <p>Quantitative data collected during the intervention will include the administration of the COIL Assessment at three different time points: at the start of the intervention, the four-week mark, and the eight-week mark. The assessments will first be checked for internal consistency. Item characteristics will be tested for difficulty and discrimination indices. The students will also complete self-efficacy measures at three different time points during the intervention. As part of year one we will check our factor loadings to see if the hypothetical model holds. We will work with the Scientific Advisory Board (SAB), specifically Jonna Kulikovich, who has lead previous IES research grants building online assessment environments, to understand the model design possibilities and decisions of what scales to use.</p>
        <p>The frequency counts of student claims and their categorization will also be analyzed. The posts will be scored blindly by two people and a third rater will score a set of random posts to establish the reliability of the ratings. Raw percentage and Cohen&rsquo;s Kappa will be calculated.</p>
        <p>We will then run a correlation of all quantitative data at the four-week and eight-week time point. Our theory of change would suggest that as self-efficacy and agency rise, the frequency and claims and evidence will rise as well.</p>
        <p><strong>Phase III: Retrospective Analysis.</strong> During this phase the research team will collectively conduct a comprehensive and exhaustive retrospective analysis (Cobb, et al., 2003; Gravemiejer &amp; Cobb, 2006) of all available data. The object of this analysis will be to (a) determine the &ldquo;active ingredients&rdquo; of our intervention that are likely to be factors related to its success in any context, (b) consider adjustments that may enhance the intervention in the following years (Years 2 and 3), (c) evaluate findings in relation to existing theory and research, and (d) identify context-specific factors. The members of the Scientific Advisory Board will participate in a portion of these discussions via teleconferencing or online webinar applications. The research team will also determine the conference presentations, technical reports, and publications that will be the focus of each summer&rsquo;s work.</p>
        <p>2.3.4 Desired Outcomes. We will use intermittent assessments and triangulate the descriptive data with our field observations to ensure our theory of change is leading to the desired outcomes. We anticipate using a repeated measures ANOVA and that there could be an effect size of Cohen&rsquo;s d=0.3 when examining the difference in mean scores of the frequencies of claims and evidence in student writing at both the four-week mark and the eight-week mark of the intervention.</p>
        <p>Based on our theory of change, we expect to see a positive correlation between properties of participatory learning environments and frequency of argumentative idea units. We hypothesize that spaces which allow for greater participation will engage in more dialogical interactions which will improve critical evaluation and argumentative writing.</p>
        <p>&nbsp;After the conclusion of the first year, we will have refined the blogging platform. We will have also collected data to check instrument reliability to ensure we can measure the effectiveness of our theory of change. Every student and the teacher will have an updated feed reader that allows them to comment and annotate on each other&rsquo;s work while writing their own post.</p>
        <h3 id="2-4">2.4 Formative Design in Year Two</h3>
        <p>In Year Two we will use a similar formative design approach. However, we will concentrate on refining the Phase II lesson plans, developing the bias read-aloud videos to assist students and teachers in source evaluation and argumentative writing.</p>
        <h4 id="2-4-1">2.4.1 Year Two Research Questions.</h4><p> In Year Two we ask, &ldquo;Can encountering bias think alouds and receiving additional scaffolds improve student critical evaluation and argumentative writing skills?&rdquo; We will shift our focus from developing learning activities about exploring how &ldquo;I shape truth&rdquo; to refining the learning activities and technologies for students to consider the implications of how &ldquo;we shape truth&rdquo; in online spaces.</p>
        <h4 id="2-4-2">2.4.2 Overview of Research Activities.</h4>
        <p> Year Two will be an iterative design process that proceeds through the same four phases as Year One. However, in Year Two we will be in two classrooms across each state, CT and MI, during each of the eight-week periods. This means we will conduct our research in a total of eight classrooms in Year Two. The second phase will begin after the same Phase I Baseline data from Year One is collected.</p>
        <p><strong>Setting and Participants:</strong>In Year Two of the formative design, the lessons will take place in four different classrooms in four different schools, two in each state. The same cohort of Year One teachers will be involved as well as the addition of a new cohort. Each intervention period will last a total of four weeks. However, all students and teachers will be given access to the blogging platform and the social reader at the beginning of the year. This will let us explore the role teacher experience has in shaping hybrid learning environments to support argumentative learning.</p>
        <p>The participants will have access to an online coach who will offer pre-recorded tutorials on an as-needed basis. Teachers will also be able to attend open office hours that are hosted online. These will be drop in sessions using video chat software.</p>
        <p><strong>Material:</strong>The Phase II lesson plans revolve around students investigating contemporary issues in social sciences and the humanities. The topical choices will be developed by the research team and classroom teachers. We will first begin by examining the local curriculum with the teachers to identify possible inquiry topics. These choices will then be refined by the SAB. The lessons will consist of eight 45-minute to one hour lessons delivered twice a week but using a simulated internet environment. Each page will have a corresponding video where a character, or biased avatar, narrates and annotates the source from a particular perspective.</p>
        <p><strong>Phase II: Implementing and Developing the Learning Activities .</strong> Phase II development will begin with the Principal Investigators and Graduate Assistants drafting the learning activities. They will then present these drafts to the SAB. Once topics are chosen, the research team will create the websites.</p>
        <p>Using methods adopted from Leu et al. (2014) the researchers will follow a protocol to create a simulated internet given the challenges of scoring and assessing learning on the open web. Greg McVerry, Principal Investigator, lead the effort to create the content for the Online Reading Comprehension Assessment IES grant (Kulikowich, 2013). First researchers will conduct cognitive labs with students to identify search terms and patterns. Next researchers will use these keywords to search out websites. A list of websites will be developed. Reading levels will be calculated and qualitative components of text complexity will be considered. The SAB will then complete a survey indicating how they feel about a source. Finally these webpages will be remixed into HTML and hosted on university servers.</p>
        <p>Next the scripts for the biased real alouds will be recorded. They will include the use of five websites per social topic. Two sources will be chosen on each side of an issue, with one additional source considered to be the most neutral. Two avatars will be created, one for each of the positions. The avatars will be pop-up windows with an animated mouse that hovers and highlights. Each avatar will complete a think aloud for two sites they disagree with and one site where they share an opinion. Each avatar in a given social set will read the source considered most neutral.</p>
        <p>After each script is written the avatar and screen recordings of website mouse clicks, and cursor highlights of annotation, will be recorded. The voice of the avatars will be from the PIs and research assistants. These videos will then be layered as proxies on top of the original sources so users can toggle them on and off in their social reader.</p>
        <p>The avatars will then undergo a series of cognitive labs before deployment. In conjunction with the classroom teacher, students will be chosen to participate. Students will be asked to identify key decisions they make when summarizing the conclusions of sources through a think-aloud protocol. The participants will also be asked how about the avatars and their perspectives.</p>
        <p>Next the Phase II lessons will be developed. We will begin by first designing the pre-game learning challenges. These are short 15 minute live or web based lessons designed to build in background skills around searching and navigating author credibility. Using methods outlined in previous research (Castek 2010; Coiro et al, 2015,) we will develop machine scorable activities around identifying an author, evaluating author authority, and considering author perspective. We will also have mini-lessons on rhetorical devices, use of claims and evidence, and annotating for credibility. The lessons will focus on text structure and annotation utilizing tools developed in Phase I. The curriculum development will follow the same model as Phase I with content validity provided by the SAB.</p>
        <p>We will then develop the eight week unit for the &ldquo;game&rdquo; phase (Kuhn &amp; Crowell, 2011) and corresponding learning materials in conjunction with the classroom teacher. These activities will introduce the new interactive graphic organizers, and explain the use of the simulated internet. As the students complete research they will be using annotation tools and taking notes on their personal domains.</p>
        <p>Finally, we will develop the prompts for the &ldquo;end game&rdquo; (Kuhn &amp; Crowell, 2011) portion of the intervention. Given the role of agency in our student model we will provide dyads or triads of students a choice of four topics. They will then create a digital essay and write an argumentative piece.</p>
        <p>The classrooms teachers will then receive a two-day training on supporting student blogging platforms in the classroom. Then in each of the four settings the participants will engage in the second phase of the learning activities included in the lesson. Similar to Year One, the interventions will take place in two 45-60 minute classes over eight weeks. After eight weeks, a second class in each of the four schools will conduct the intervention.</p>
        <p><strong>Phase II: Implementing and Developing the Technology.</strong> As stated above, the Phase II technology development focuses on interactive graphic organizers. The interactive graphic organizers will rely heavily on javascript and the micropub and microsub APIs. In short, students will be able to visit the domain of the graphic organizer and &ldquo;fill in a box&rdquo;; this will then publish to their own domain. Alternatively, students can publish from their own domain, and this entry will pre-populate on their graphic organizers.</p>
        <p><strong>Data Collection and Analysis.</strong> The graduate assistants will act as participant observers who attend twice-weekly instruction and offer assistance to the classroom teacher, who remains the primary instructor and delivers the lessons included in the intervention. The principal investigators will provide just-in-time coaching and feedback.</p>
        <p>Qualitative data will be collected by research team members, who include Principal and Co-Investigators, as well as graduate research assistants who have had explicit training in gathering and analyzing qualitative data. Data will stem from (a) field notes of&nbsp;_classroom observations by the research team; (b) weekly interviews/debriefings (15-30 minutes) with teachers; (c) periodic focus-group interviews with students; (d) cognitive labs with individual students and (e) teacher self-reports of each lesson (n=16) and reflections about #QTW, which are particularly useful for our awareness of possible effects and issues that arise during times when a member of the research team is not present..</p>
        <p>We will also examine field notes to continue our efforts to understand how space shaped the quality of hybrid learning environments. We will meet with the SAB to review results from Phase I. We will then develop a coding system to encourage the use of specific practices noted in Year One with the goal of increasing the frequency of these techniques in Year Two.</p>
        <p>During the end game&nbsp;inquiry, all group discussions will be recorded using computer software. Two groups from each class will be randomly selected and their recordings transcribed. This data will then be coded using methods outlined in (Jadallah et al., 2011) with each utterance&nbsp;being considered a unit of analysis. Prompts will be coded for interrogating sources, addressing perspectives, use of evidence, feedback, and reflection.</p>
        <p>Quantitative data collected in Year Two will be very similar to the data collected in Year One. The same battery of baseline assessments from Phase I will be administered. We will add frequency&nbsp;counts of student annotations and the codes they assign to annotation to our correlation testing.</p>
        <p><strong>Phase III Retrospective Analysis.</strong> As we finish Year II, we will examine all the data collected in both formative design years to inform final changes before the pilot study. In Year Two we did not include the Phase I lessons. These lessons provided an exploration of self while also scaffolding the blogging platform. A comparison of Year Two and One field notes will provide insight into the types of supports students and teachers will need. We will also compare demographic data between the two years. Specifically, we will seek to triangulate the claims and evidence students use with the specific artifacts from learning activities, field notes, and platform uses.</p>
        <p>The retrospective analysis will first occur in December after the intervention comes to a conclusion in four classrooms who completed the lessons. Focus will be placed on analyzing the results of cognitive labs and revising the avatar scripts. Then after the conclusion of Year Two the scientific advisory board will gather for one last time to make final revisions based on the second cycle of learning activities delivered in Year Two.</p>
        <p>2.4.3 Desired Outcomes. After the conclusion of the Year Two formative assessment we will have greater evidence that our theory of change leads to desired outcome. First, with a sample size between 100-120 in Year One, we hope to derive reliability estimates of our measure before undertaking the pilot study in Year Two. This will help to ensure we can estimate effect sizes that would indicate we are progressing towards our outcomes in the theory of change.</p>
        <p>At the conclusion of Year Two, we will have developed and recorded avatar scripts for four different argumentative topics in the field of humanities and social studies. This will be a total of 20 different bias read alouds.</p>
        <h3 id="2-5">2.5 Pilot Study in Year Three</h3>
        <p>In Year Three of the grant we will perform a pilot study testing out both the learning activities and the blogging platform developed in the first two years of the project. The goals of the study will be to provide evidence on the relationship between source evaluation, argumentative writing and any possible effects our learning interventions may have.</p>
        <h4 id="2-5-1">2.5.1 Participants.</h4>
        <p>This will be an approximate sample size of 300 students. According to Tabachnick and Field (2001), a sample of 300 participants exceeds their guidelines for a t-test using a Cohen&rsquo;s d effect size of 0.3 and also for any possible regression analysis of 100 + m, where m equals the number of predictors. This sample size is also adequate for a regression model with one dependent variable and three independent variables with an =.05, a desired power size of 0.8, and an anticipated effect size of 0.15 (Sloper, 2010). This anticipated Cohen&rsquo;s f2 is a medium effect. The estimate of power size was chosen to ensure an adequate effect (Sloper, 2010).</p>
        <p><strong>Setting:</strong>strong> The pilot study will take place in four schools across two states, with two schools in each state. We have chosen to focus on middle school students due to federal child data protection laws and alignment with curriculum goals. There will be one classroom in each school assigned to one of three conditions: Condition A, Condition B, and control. Each group will have 300 students. While this sample size is large for a Goal Two: Development grant it will provide balanced design to strengthen our estimations and allow us to estimate the reliability of our measures when estimating effect sizes to track if our theory of change will lead to our hypothetical educational outcomes.</p>
        <h4 id="2-5-2">2.5.2 Measures</h4>
        <p> Assessments in the pilot study will include the AWC-SBA, the COIL, a survey of self-efficacy of writing, and the internet use survey. All reliability estimates will be conducted after the Year Two Formative Design. We will also have access to frequency counts of student annotations to establish validity of our instruments.</p>
        <p>2.5.3 Methods The pilot study will use a switch replication design with two conditions. Both groups will start with the assessment battery and then be given access to the blogging platform. Group A will begin the eight-week intervention while group B completes normally scheduled classroom activities with the option of using the blogging platform. The control group will complete the battery of assessments in the third testing window. A research assistant will observe the control group 4 times throughout the intervention and interview the classroom teacher in order to capture regular classroom practices about writing instruction.</p>
