        <h4 id="2.5.4">2.5.4 Analysis</h4>
        <p>The data analysis to examine the effects of instruction on source evaluation and scores on the AWC-SBA will be different models. We will first begin by testing for the classical assumptions for a repeated measures design. First, we will test if either condition had learning gains over a control group which will consist of the same sample size and be given the three assessments at the final time point.</p>
        <p>We will then calculate and run correlations and consider the inter-class correlations of our variables at each time point. Given that this is a timed series intervention the scores will not be dependent on each other. Meaning instruction that impacted scores on the first assessment may also impact scores on the third.</p>
        <p>Next we will conduct multiple regression analysis models that test for mean difference scores on the AWC using each of the dependent variables while conditioning on two covariates: prior internet use and offline writing ability.</p>
        <p>If there is a significant difference between the means with a medium to large effect size, we will have evidence that our theory of change lead to the expected outcomes. If we do not find a statistical difference we will also establish that our intervention did not hinder students&rsquo; progress when compared to their peers. If the control group has a significant greater average then we will have practicality evidence that at some point our interventions did not lead to student growth.</p>
        <p>Then to answer our research questions we will use a series of t-test at each time point. To answer research question one, the dependent variable will be the self-efficacy measure given at three timepoints (Time: 1, 2, 3), and the independent variable will be the order factor that represented the sequence of instruction for each student (Order: blogging platform with intervention, intervention after having blogging platform). Covariates will include a proxy of prior knowledge of the internet using a self report measure of internet frequency which has been used in previous studies (Leu et al., 2015) and the previous years scores on the Smarter Balanced Consortium writing scores.</p>
        <p>To answer research question two, a repeated measures design the dependent variable will be the AWC measure given at three timepoints (Time: 1, 2, 3), and the independent variable will be the order factor that represented the sequence of instruction for each student (Order: blogging platform with intervention, intervention after having blogging platform). We will again use the survey of internet use and prior writing ability as a covariate.</p>
        <p>To answer research question three, the dependent variable will be scores on the COIL given at three timepoints (Time: 1, 2, 3), and the independent variable will be the order factor that represented the sequence of instruction for each student (Order: blogging platform with intervention, intervention after having blogging platform). We will again use the survey of internet use as a covariate.</p>
        <p>In conjunction with the SAB, specifically Jonna Kulowich, a variety of model fits will be tested to see what best explains variance in argumentative writing skills. This will allow us to estimate the effect of time. Other mediating variables that may be included in the model include prior knowledge, as measured using concept maps, and critical evaluation scores on the COIL. These data are intended to complement and extend the qualitative and quantitative data collected during the intervention phase. These statistical comparisons may be made, but these comparisons are not intended to carry the weight of a randomized experimental design or analysis using HLM procedures, which would be more consistent with a Goal Five project. Furthermore, we do not have the sample sizes to do so. However, it does allow us an opportunity to field-test these procedures, especially in Year Three with an eye toward a subsequent Goal Three project. We also expect that these assessments may be useful, not just for data collection and analysis, but also useful tools for teachers who wish to formatively assess students&rsquo; progress.</p>
        <p>A switch replication design was chosen for the study given our firm belief that all adolescents will benefit from writing on their own domain and receiving additional instruction in digital literacies. While a quasi-experimental study with a control group would allow us to estimate if treatment groups performed better than no instruction at all, the required sample size for such is suited for a Goal Three research project.</p>
        <p>Furthermore, a switched replication design lets us better understand any possible mediators between time and order of instruction. Previous research introducing technology found an initial drop in performance on measures of reading comprehension (Leu et al, 2016). This finding is mirrored in qualitative studies of distributed classrooms using blogging technologies similar to our #QTW intervention. Our proposed model will allow us to explore for any mediators of time and order that should be further explored when we seek to scale up the grant as a Goal Three.</p>
        <h3 id="2-6">2.6 Practicality, Fidelity, and cost study in Year Four</h3>
        <p>It is essential that any instruction model to be practical. Beyond the data analysis in Year Four we will also focus on practicality. We define this as having reproducible fidelity and a low cost. Time and money are precious commodities during the school year. For this proposal, we have thought carefully about this issue, recognizing that no instructional model will be adopted unless it is ultimately practical to stakeholders. First, the implementation of any model must have fidelity to ensure its success, yet each classroom is a unique context. We try to address this paradigm by creating choice within a constrained system. We will develop a series of learning activities and a similar tech set-up, but students and teachers can adopt the blogging to their local platforms. To measure fidelity in the Year Three pilot study the research team will use a checklist of &ldquo;Qualities of Hybrid Writing Spaces&rdquo; developed in conjunction with the scientific advisory board after the formative design experiments in Year Two.</p>
        <p>Second, we have already piloted an initial versions of our model (McVerry, 2015) and draw on a long history of distributed courses. Scholars have already looked closely at the initial version of the model and made changes to it, in order to make it more practical for a whole school context.</p>
        <p>We will also conduct a cost analysis in Year Four. We have built in an online coach into our model. While some see this as an expense districts could not afford, we believe non-union, non-employed coaches provide a huge cost saving opportunity. The cost of two districts splitting a part time coach is vastly cheaper than each having a full-time employee with the associated fringe.</p>
        <p>To complete a cost benefit analysis in Year Four we will first develop criteria for ascertaining what is considered a cost. If, for example, a graduate assistant or PI must teach in Year Three, the cost of one day for a secondary teacher will be added. The technology costs are fixed and easy to project to scale.</p>
        <p>We will then look to our benefits in terms of cost. In order to do this, we will examine the student learning outcomes as measured by the AWC. This will then be compared to other writing instruction curriculums that have had similar outcomes.</p>
